import React from 'react';
import "./App.css";
import { useHistory } from 'react-router-dom';

function Participante() {
    const handleLogout = () => {
        history.push('/login');
      };
    <div>
        <h1>¡Bienvenido Participante!</h1>
        <button onClick={handleLogout}>Cerrar Sesión</button>
    </div>
}

export default Participante;
